import styled from 'styled-components';

export const ExpenseItem = styled.div`
    display: flex;
    justify-content: space-between;
    border: 1px solid;
    border-radius: 5px;
    margin: 10px
    align-items: center;
`;

export const Description = styled.h3``;

export const Amount = styled.div``;

export const Date = styled.div``;
